import "./stories.scss"; 
import friend4 from "../../Assets/UnitedSikhs.jpeg";

export default function Stories() {

    const {currentUser} = useContext(AuthContext)
    //TEMPORARY DUMMY DATA 
    const stories = [
        {
            id: 1, 
            name: "United Sikhs", 
            img: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Flag_of_the_United_Nations.svg/1200px-Flag_of_the_United_Nations.svg.png"
        },
        {
            id: 2, 
            name: "Internet Society", 
            img: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Flag_of_the_United_Nations.svg/1200px-Flag_of_the_United_Nations.svg.png"
        },
        {
            id: 3, 
            name: "United Sikhs", 
            img: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Flag_of_the_United_Nations.svg/1200px-Flag_of_the_United_Nations.svg.png"
        },
        {
            id: 4, 
            name: "United Sikhs", 
            img: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Flag_of_the_United_Nations.svg/1200px-Flag_of_the_United_Nations.svg.png"
        }
    ]
    return (
        <div className="stories">
            <div className="story">
                <img src={currentUser.profilePic} alt="" />
                <span>{currentUser.name}</span>
            </div>
            {stories.map(story =>(
                <div className="story">
                    <img src={story.img} alt="" />
                    <span>{story.name}</span>
                </div>
            ))}
        </div>
    )
};
